export default function TeachIcons() {
  return (
    <>
      {stacks.map((stack: Stack, index: number) => {
        return (
          <div className="flex items-center space-x-2 text-sm" key={index}>
            {stack.icon}
            <p>{stack.name}</p>
          </div>
        );
      })}
    </>
  );
}

interface Stack {
  name: string;
  icon: JSX.Element;
};
